import React from 'react'
import Login from '../components/pages/Login'

export default function Home() {
  return (
    (() => {
      switch (window.location.pathname) {
        case '/login':
          return <Login />
        default:
          return <H1>Masuk</H1>
      }
    })()
  )
}
